import React, { useState, useEffect } from "react"
import { useTheme } from "../context/ThemeContext";

export default function TrainingLogRow({ rowData, onUpdate }) {
    const { theme } = useTheme();
    const [muscleGroup, setMuscleGroup] = useState(rowData.muscleGroup);
    const [exercise, setExercise] = useState(rowData.exercise);
    const [sets, setSets] = useState(rowData.sets); // <-- FIXED: do not wrap in []
    const [notes, setNotes] = useState(rowData.notes);
    const [showNotes, setShowNotes] = useState(rowData.showNotes);
    const [weightUnit, setWeightUnit] = useState(rowData.weightUnit);

    const handleSetChange = (index, field, value) => {
        setSets(sets =>
            sets.map((set, i) =>
                i === index ? { ...set, [field]: value } : set
            )
        );
    };

    const handleWeightKeyDown = (e, index) => {
        // Optionally, you can add logic here if you want to handle Enter key
    };

    const toggleWeightUnit = () => {
        const newUnit = weightUnit === "lbs" ? "kg" : "lbs";
        const convertedSets = sets.map(set => {
            let weight = set.weight;
            if (weight !== '') {
                weight = parseFloat(weight);
                if (!isNaN(weight)) {
                    weight = newUnit === "kg"
                        ? (weight / 2.20462).toFixed(2)
                        : (weight * 2.20462).toFixed(2);
                }
            }
            return { ...set, weight: weight };
        });
        setSets(convertedSets);
        setWeightUnit(newUnit);
    };

    const addSet = () => {
        setSets([...sets, { reps: '', weight: '' }]);
    };

    const removeSet = (index) => {
        if (sets.length > 1) {
            setSets(sets.filter((_, i) => i !== index));
        }
    };

    useEffect(() => {
        onUpdate({
            ...rowData,
            muscleGroup,
            exercise,
            sets,
            notes,
            showNotes,
            weightUnit,
        });
    }, [muscleGroup, exercise, sets, notes, showNotes, weightUnit]);

    // Sync state with rowData when it changes (e.g. on reload)
    useEffect(() => {
        setMuscleGroup(rowData.muscleGroup);
        setExercise(rowData.exercise);
        setSets(rowData.sets);
        setNotes(rowData.notes);
        setShowNotes(rowData.showNotes);
        setWeightUnit(rowData.weightUnit);
    }, [rowData]);

    return (
        <div style={{
            display: "grid",
            gridTemplateColumns: "2fr 1fr 1fr 1fr 2fr 50px",
            gap: "1rem",
            padding: "1rem",
            background: theme.surface,
            borderBottom: "none",
            transition: "background-color 0.3s ease, border-color 0.3s ease"
        }}>
            {/* Exercise */}
            <input
                type="text"
                value={exercise}
                onChange={(e) => setExercise(e.target.value)}
                placeholder="Exercise name"
                style={{
                    background: theme.inputBackground,
                    color: theme.text,
                    border: `1px solid ${theme.inputBorder}`,
                    borderRadius: "6px",
                    padding: "0.5rem",
                    fontSize: "0.9rem",
                    transition: "background-color 0.3s ease, color 0.3s ease, border-color 0.3s ease"
                }}
            />

            {/* Sets */}
            <input
                type="text"
                value={sets}
                onChange={(e) => setSets(e.target.value)}
                placeholder="Sets"
                style={{
                    background: theme.inputBackground,
                    color: theme.text,
                    border: `1px solid ${theme.inputBorder}`,
                    borderRadius: "6px",
                    padding: "0.5rem",
                    fontSize: "0.9rem",
                    transition: "background-color 0.3s ease, color 0.3s ease, border-color 0.3s ease"
                }}
            />

            {/* Reps */}
            <input
                type="text"
                value={sets.map(set => set.reps).join(', ')}
                onChange={(e) => {
                    const newSets = sets.map((set, index) => ({
                        ...set,
                        reps: e.target.value.split(', ')[index] || ''
                    }));
                    setSets(newSets);
                }}
                placeholder="Reps"
                style={{
                    background: theme.inputBackground,
                    color: theme.text,
                    border: `1px solid ${theme.inputBorder}`,
                    borderRadius: "6px",
                    padding: "0.5rem",
                    fontSize: "0.9rem",
                    transition: "background-color 0.3s ease, color 0.3s ease, border-color 0.3s ease"
                }}
            />

            {/* Weight */}
            <input
                type="text"
                value={sets.map(set => set.weight).join(', ')}
                onChange={(e) => {
                    const newSets = sets.map((set, index) => ({
                        ...set,
                        weight: e.target.value.split(', ')[index] || ''
                    }));
                    setSets(newSets);
                }}
                placeholder="Weight"
                style={{
                    background: theme.inputBackground,
                    color: theme.text,
                    border: `1px solid ${theme.inputBorder}`,
                    borderRadius: "6px",
                    padding: "0.5rem",
                    fontSize: "0.9rem",
                    transition: "background-color 0.3s ease, color 0.3s ease, border-color 0.3s ease"
                }}
            />

            {/* Notes */}
            <input
                type="text"
                value={notes}
                onChange={(e) => setNotes(e.target.value)}
                placeholder="Notes"
                style={{
                    background: theme.inputBackground,
                    color: theme.text,
                    border: `1px solid ${theme.inputBorder}`,
                    borderRadius: "6px",
                    padding: "0.5rem",
                    fontSize: "0.9rem",
                    transition: "background-color 0.3s ease, color 0.3s ease, border-color 0.3s ease"
                }}
            />

            {/* Delete Button */}
            <button
                onClick={() => onUpdate(null)}
                style={{
                    background: theme.danger,
                    color: "#fff",
                    border: "none",
                    borderRadius: "6px",
                    padding: "0.5rem",
                    cursor: "pointer",
                    fontSize: "0.8rem",
                    fontWeight: "600",
                    transition: "background 0.2s ease"
                }}
                onMouseOver={e => e.currentTarget.style.background = theme.dangerHover}
                onMouseOut={e => e.currentTarget.style.background = theme.danger}
            >
                Ã—
            </button>
        </div>
    );
}
